import React from 'react';
import styled from 'styled-components';
import { colors } from '../../styles';
import Container from '../Container';

const Box = styled.div`
  background-color: ${colors().grey};
  min-height: 300px;
`;

function Video() {
  return (
    <Box>
      <Container></Container>
    </Box>
  );
}

export default Video;
